import React, {Component} from 'react';

class charStatus extends Component{
    constructor(){
        super();
    }

    render(){
        const status = [
            {
                str: "STR",
                pow: "POW",
                dex: "DEX",
                app: "APP",
                siz: "SIZ",
                int: "INT",
                edu: "EDU",
                hp: "HP",
                mp: "MP",
                san: "初期SAN",
                idea: "アイデア",
                luck: "幸運",
                knowledge: "知識"
            }
        ];

        const row = status.map((status,i)=>{
            return(
                <tr key={i}>
                    <td>status</td>
                </tr>
            )
        })

        return(
            {row}
        )
    }

}

export default charStatus;
